  [],\n\t\"num_tags\": 0,\n\t\"name\": \"thermosalinograph-data-of-the-hawaii-ocean-time-series-hot-program-in-the-north-pacific-100-milc523a\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The HOT program makes repeated observations
  of the physics, biology and chemistry at a site approximately 100 km north of Oahu,
  Hawaii. Two stations are visited about once a month: Kahe Point (Station 1: 21.34N,
  158.27W) and Station ALOHA (Station 2: 22.75N, 158W). Various other stations are
  made intermittently in support of similar research objectives or mooring deployments.nnHOT
  thermosalinograph data are recorded every 10 seconds from water collected by a continuous
  seawater system aboard each vessel from a depth of about 3 meters.nnThis NODC Accession
  contains thermosalinograph data for HOT cruises 208-217 during 2009. CTD and Niskin
  bottle data from the same cruisesnare available in separate Accessions.nnHOT 207
  cruise was cut short due to a problem with the winch. No data are available.\",\n\t\"owner_org\":
